import Issues from './Issues'
import axios from 'axios'

export const addIssue = (issueTitle, issueDescription, issueLabels) => {
    const url =
    'https://issue-tracker-spring-boot.herokuapp.com/issue/'
    const issue = {
        title: issueTitle,
        description: issueDescription,
        labels: issueLabels
    }

    axios.put(url, issue)
    new Issues().getIssueList()
}
